import * as React from 'react';
import { AppProvider } from '@toolpad/core/AppProvider';
import { SignInPage } from '@toolpad/core/SignInPage';
import { useTheme } from '@mui/material/styles';
import { TextField } from '@mui/material';

const providers = [{ id: 'credentials', name: 'Credentials' }];

const BRANDING = {
  logo: (
    <img
      src="https://mui.com/static/logo.svg"
      alt="MUI logo"
      style={{ height: 24 }}
    />
  ),
  title: 'Créer un nouvel utilisateur',
};

const signUp = async (provider, formData) => {
    return new Promise((resolve) => {
      setTimeout(() => {
        const email = formData?.get('email');
        const password = formData?.get('password');
        const prenom = formData?.get('prenom');
        const nom = formData?.get('nom');
  
        console.log(`Creating user with ${provider.name}: ${email}, ${password}, ${prenom}, ${nom}`);
  
        resolve({
          type: 'CredentialsSignup',
          error: null,
          user: { email, prenom, nom }
        });
      }, 500);
    });
  };
  
  export default function CreerUtilisateur() {
    const theme = useTheme();
  
    return (
        <AppProvider branding={BRANDING} theme={theme}>
          <SignInPage
            signIn={signUp}
            providers={providers}
            slotProps={{ emailField: { autoFocus: false } }}
            mode="signup"
            extraFields={[
              <TextField key="prenom" name="prenom" label="Prénom" fullWidth />,
              <TextField key="nom" name="nom" label="Nom" fullWidth />
            ]}
          />
        </AppProvider>
      );
    }
